%[text] ## Problem 1. Data Collapse for Laminar Pipe Flow (Buckingham-$\\Pi$)
%[text] In practice, fluid flow in pipes is commonly encountered in systems. For example, the flow of liquid propellants through the network of ducts and lines found in a rocket engine.
%[text] "In fully developed laminar flow, each fluid particle moves at a constant axial velocity along a streamline and the velocity profile *u(r)* remains unchanged in the flow direction." \[1\] See Fig. 8-11.
imshow('Fig8-11_LaminarFlow.png')
%[text] - \[*Newtonian fluid* - viscosity is constant; shear stress is proportional to shear rate.\] \
%[text] Why aerospace engineers care about the Newtonian assumption:
%[text:table]
%[text] | **Area** | **Newtonian assumption works** | **Non-Newtonian risk** |
%[text] | --- | --- | --- |
%[text] | Aerodynamics | ✔ External flow | ✖ Icing fluids, contaminants |
%[text] | Propulsion | ✔ Gas dynamics | ✖ Slurries, gels |
%[text] | Thermal | ✔ Convective models | ✖ Phase-changing coatings |
%[text] | CFD | ✔ Standard solvers | ✖ Needs constitutive modeling |
%[text:table]
%%
%[text] ### 1. Raw plot
%% HW2 Problem 1 — Raw plot: Δp vs Q grouped by constant (D, mu, rho, L)
% 1) Reads pipe_lab.csv
% 2) Plots one curve per unique set of (D, mu, rho, L)

clear; clc; close all;

%% ---- 1) Read the raw data file ----
% Assumes pipe_lab.csv is in the current folder. Otherwise, set full path here:
fname = "pipe_lab.csv";
T = readtable(fname);

% Expected columns (per HW PDF):
% D_mm, mu_mPa_s, rho_kg_m3, L_m, Q_mL_s, dp_kPa
% If your file has different headers, adjust these names accordingly.
D   = T{:,2};  % [mm]
mu  = T{:,3};  % [mPa*s]
rho = T{:,4};  % [kg/m^3]
L   = T{:,5};  % [m]
Q   = T{:,6};  % [mL/s]
dp  = T{:,7};  % [kPa]

%% ---- 2) Group by constant parameters and plot Q vs Δp ----
% If any of these are floating with tiny roundoff, rounding makes grouping robust.
Dg   = round(D,   6);
mug  = round(mu,  6);
rhog = round(rho, 6);
Lg   = round(L,   6);
%%
G = findgroups(Dg, mug, rhog, Lg); % Assign group numbers
nG = max(G); % Total number of unique groups
%%

figure('Color','w','Visible', 'off');
%figure('Color','w');
hold on; grid on; box on;

% Plot each group as its own curve
for k = 1:nG
    idx = (G == k);

    % Sort by Q so curves don't zig-zag
    [Qk, order] = sort(Q(idx));
    dpk = dp(idx);
    dpk = dpk(order);

    plot(Qk, dpk, '-o', 'LineWidth', 1.4, 'MarkerSize', 5);
end

xlabel('Q [mL/s]');
ylabel('\Delta p [kPa]');
t = title('\Delta p vs Q (grouped by constant D, \mu, \rho, L)');
t.Units = 'normalized';
t.Position(2) = 1.00;
t.Position(1) = 3.00;

% Build a readable legend label for each curve
labels = strings(nG,1);
for k = 1:nG
    idx = (G == k);
    % pull representative values from first row in group
    i0 = find(idx, 1, 'first');
    labels(k) = sprintf('D=%.3g mm, \\mu=%.3g mPa·s, \\rho=%.3g kg/m^3, L=%.3g m', ...
        D(i0), mu(i0), rho(i0), L(i0));
end
legend(labels, 'Location', 'bestoutside');
%%
%% Optional: if you want to also save the figure
%exportgraphics(gcf, "dp_vs_Q_grouped.png", "Resolution", 600);
%%
%imshow('dp_vs_Q_grouped.png');
%%
fig = gcf;
set(fig,'Units','inches');
set(fig,'Position',[0.5 0.5 8.5 4.8]);   % wide figure %[output:5073d9a1]
set(fig,'PaperPositionMode','auto');     % keep on-screen size for printing/export
%%
%[text] %[text:anchor:TMP_5f80] <u>Discussion</u>
%[text] The curves do not collapse since the experiment's input parameters (independent variables - D, $\\mu$, $\\rho$, and *L*) have not been properly *nondimensionalized.* In other words, it is not possible to gain insight about the relationships between the parameters from this raw plot. 
%[text] - \[Data collapse - is a way of establishing *scaling*; scaling may be accomplished through **nondimensionalization.** The law of dimensional homogeneity guarantees that every additive term in an equation has the same dimensions. \[1\]\] \
%[text] When properly nondimensionalized, the data from many experiments will produce a family of curves (or a single curve) that reveals the underlying physics or makes a universal law more apparent. As an illustration of this claim, the two plots shown in the figure below show "raw" computational data (A) and collapse when plotted using suitable dimensionless variables (B) - as presented by Erlich, et.al. in their work on *Physical and geometric determinants of transport in feto-placental microvascular networks*. \[2\]
figure; % Force a new figure window to open %[output:60c4acfa]
imshow('Computational-data-A-collapse-B.png') %[output:9ac0f9d8] %[output:2324ad77] %[output:60c4acfa]
%%
%[text] ### 2. Buckingham $\\Pi$ analysis
%[text] <u>Step 1</u>:
%[text] Pressure drop:
%[text] $\\Delta p = f(Q, D, L, \\mu, \\rho) \\rightarrow n = 6$
%[text] **Note: Only one dependent parameter is analyzed here,** $\\Delta p$; also, it is assumed that this dependent parameter is a function of volumetric flow rate, $Q$. 
%[text] 
%[text] <u>Step 2</u>:
%[text:table]
%[text] | **Parameter** | $\\Delta p$ | $Q$ | $D$ | $L$ | $\\mu$ | $\\rho$ |
%[text] | --- | --- | --- | --- | --- | --- | --- |
%[text] | Primary dimensions | $M^1L^{-1}T^{-2}$ | $L^3T^{-1}$ | $L^1$ | $L^1$ | $M^1L^{-1}T^{-1}$ | $M^1L^{-3}$ |
%[text:table]
%[text] 
%[text] <u>Step 3</u>:
%[text] As an initial guess, set the reduction $j$ as the number of primary dimensions --
%[text] $j = 3$
%[text] (a) If this initial guess is *correct*, the number of $\\Pi$'s, or dimensionless groups expected is $k$:
%[text] $k = n - j = 6 - 3 = \\mathbf{3}$
%%
%[text] <u>Step 4</u>:
%[text] Choose $j$ repeating parameters --
%[text] - **Hint of the day:** A *wise* choice of repeating parameters for most fluid flow problems is a **length**, a **velocity**, and a **mass** or **density**. \
% Call the 'buckinghamPi' sub-routine;
% it computes the Buckingham Pi groups (one set for 1 dependent variable) 
% based off the input of repeating parameters.

params = ["dP", "Q", "D", "L", "mu", "rho"];
%depParams = ["dP", "Q"];
dimNames = ["M", "L", "T"];
%%
% Dimensions:M  L  T    % Parameters:
dimMatrix = [1 -1 -2;   % dP
             0  3 -1;   % Q
             0  1  0;   % D
             0  1  0;   % L
             1 -1 -1;   % mu
             1 -3  0];  % rho
%%
results = buckinghamPi(params, dimNames, dimMatrix); %[output:7c8a0e1a] %[output:357cc935] %[output:3b0c6d86] %[output:96ac995d] %[output:4fc789b6] %[output:7c3cc891] %[output:7dd18a35] %[output:1c11a6a6] %[output:9d0fcc73] %[output:81c4efde] %[output:4dbe87e7] %[output:81121477]
disp(results.exponents); %[output:142d360c]
disp(results.piGroups); %[output:5506e104]
%%
%[text] <u>Step 5</u>:
%[text] Construct $k \\space \\Pi$'s, and manipulate as necessary.
clipboard('copy', latex(results.piGroups))
%[text] $\\Pi\_1 = \\left( \\frac{D^2\\,\\mathrm{dP}\\,\\rho }{\\mu ^2} \\right)$        (5-1)
%[text] For laminar flow, the pressure drop in a pipe is \[1\]:
%[text] $\\Delta P = P\_1 - P\_2 = \\frac{32 \\mu L V\_{avg}} {D^2}$        (5-2)
%[text] Sub (5-2) into (5-1):
%[text] $\\Pi\_{1, modified} = \\left( \\frac{32 L V\_{avg} \\rho} {\\mu} \\right)$        (5-3)
%[text] Manipulate further, multiply by taking the inverse of the fraction then multiplying by a pure dimensionless constant 2 and replace *characteristic length* with *diameter* to obtain:
%[text] ${\\Pi\_{1, modified} = \\left( \\frac{64} {Re} \\right) = f$     (5-4)
%[text] - $f$ is known as the friction factor for laminar flow in a circular pipe; this *dimensionless parameter* shows this factor to be a function of the **Reynolds number** only (independent of pipe roughness). \[1\] \
%[text] $\\Pi\_2 = \\left( \\frac{L}{D} \\right) = AR$                    (5-5)
%[text] The established nondimensional parameters are the **friction factor** (5-4) and the **aspect ratio** (5-5).
%%
%[text] <u>Step 6</u>:
%[text] Write the functional relationship
%[text] $\\Delta P = f(f, AR)$
%%
%[text] ## Problem 2. Passive scalar transport from Reynolds Transport Theorem
%[text] - \[A passive scalar is a scalar quantity that is transported by advection (the transfer of a substance, or matter, by bulk motion of a fluid) and diffusion in a flow but does not influence the velocity field or fluid dynamics.\] \
%[text] #### 1. Time rate of change of dye mass
%[text] ### Fundamentals
%[text] <u>a. Conservation of Mass Principle</u>
%[text] $m\_{in} - m\_{out} = \\Delta\_{CV}$
%[text] *The net mass transfer to or from a control volume during a time interval* $\\Delta t$ *is equal to the net change in the total mass within the control volume during* $\\Delta t$. \[1\]
%[text] #### **General Conservation of Mass**
imshow('element for cons of mass.png') %[output:331578fb]
%[text] $\\frac{d}{dt}\\int\_{\\text{CV}} \\rho \\, dV + \\int\_{\\text{CS}} \\rho \\, (\\vec{V} \\cdot \\vec{n})\\, dA = 0$     (2-1)
%[text] "... *the time rate of change of mass within the control volume plus the net mass flow rate through the control surface is equal to zero."*
%%
%[text] <u>b. Total Dye Mass</u>:
%[text] Since:
%[text] $c = \\frac{M\_{dye}} {M\_{mixture}}$
%[text] then,
%[text] $M\_{dye} = c M\_{mixture} = c \\rho\_{mixture} V$
%[text] Generally:
%[text] $M\_{dye}(t) = \\int\_{V} \\rho(x,t) c(x,t)\\, dV$        (2-2)
%%
%[text] <u>c. Time Rate of Change of Dye Mass</u>:
%[text] The dye is conserved, so expanding on the *general conservation of mass* expression (2-1) above, gives:
%[text] $\\frac{d}{dt} \\int\_{\\text{V}} \\rho c \\, dV + \\oint\_{\\partial V} (\\rho c \\vec{u} + \\mathbf{j}) \\cdot \\vec{n}\\, dA = 0$       (2-3) 
%[text] - The left integral represents the time rate of change of mass within the CV (i.e., change in a CV).
%[text] - The right integral represents the total flux through the boundary surface (i.e., change in a system).
%[text] - Where $(\\rho c \\vec{u}) \\vec{n}$ is the **advective/convective** dye flux and $\\mathbf{j} \\vec{n}$ is the **diffusive dye flux.** \
%%
%[text] #### 2. Reynolds Transport Theorem and Divergence Theorem for the Differential Equation
%[text] <u>d. Reynolds Transport Theorem</u>
%[text] For the fixed CV, RTT reduces to:
%[text] $\\frac{d}{dt} \\int\_{\\text{V}} \\rho c \\, dV = \\int\_{V} \\frac{\\partial (\\rho c)}{\\partial t} dV$
%[text] Since the CV is not moving or deforming with time, the time derivative can be moved inside since it is irrelevant whether we differentiate or integrate first. \[1\] It is expressed as a partial derivative since density and the dye mass ratio are space-dependent (functions of *x* and *t*).
%%
%[text] <u>e. Divergence Theorem on the Surface Flux</u>
%[text] $\\oint\_{\\partial V} \\mathbf{G} \\cdot \\mathbf{n}\\, dA = \\int\_{V} \\nabla \\cdot \\mathbf{G}\\, dV$
%[text] Let:
%[text] $\\mathbf{G} = (\\rho c \\vec{u} + \\mathbf{j})$
%[text] $\\oint\_{\\partial V} (\\rho c \\vec{u} + \\mathbf{j}) \\cdot \\vec{n}\\, dA = \\int\_{V} \\nabla \\cdot (\\rho c \\vec{u} + \\mathbf{j})\\, dV$
%%
%[text] <u>f. Combine Them</u>
%[text] $\\frac{\\partial(\\rho c)} {t} + \\nabla \\cdot (\\rho c \\vec{u} - \\rho D \\nabla c) = 0$         (2-4)
%%
%[text] #### 3. Incompressible Flow and Constant Density and Diffusivity
%[text] Incompressible flow:
%[text] $\\frac{\\partial{\\rho}} {\\partial{t}} = 0$ (density does not change with time)
%[text] and
%[text] $\\nabla \\cdot \\vec{u} = 0$
%[text] Expand $\\nabla \\cdot (c \\vec{u})$
%[text]  $\\nabla \\cdot (c \\vec{u}) = \\vec{u} \\cdot c + c(\\nabla \\cdot \\vec{u}) = \\vec{u} \\cdot c$
%[text] (2-4) becomes:
%[text] $\\frac{\\partial c} {t} + \\vec{u} \\cdot \\nabla c = D \\nabla^2 c$         (2-5)
%[text] - This is the simplified passive-scalar transport equation. \
%%
